import React from 'react';
import { AppBar, Toolbar } from '@material-ui/core'

const nav_links = [
    { title: `login`, path: `/login` },
    { title: `signup`, path: `/signup` },
]

const Header = () => {
    return (
        <AppBar position='static'>
           <ToolBar></ToolBar>
        </AppBar>
    )
}

export default Header;
